text:
{'text': 'Made payments on 12 feb to retrieve back diploma and transcript certificate. They told me they will take 7 days upon payment. 13 march (ONE MONTH AFTER), i prompted again after several no replies, they asked me "Need proof of my diploma and transcript cert" to verify. Excuse me? I filled up a form with all my details???? Why would i still come to you and pay if i had my certs?

Take note they only started to reply me when i asked for refund

Bad service. Still got the audacity to play victim. Where is your professionalism at?', 'languageCode': 'en'}

