text:
{'text': 'BMC International College is very good, all the staff and lectures, especially Ms. Annalyn are always supportive and helpful. They have very well knowledge and experience about hospitality industry. They always bring a very good atmosphere for students which helps them to study. I took Diploma in International Hospitality Management, all the modules were very good and important for me to study. Moreover, it was fun and memorable time, Ms. Annalyn always supported and encouraged me to do the best during my study. after completed all the modules, BMC International College provided 100% Industrial placement assistance and guided me from interview until prepared all the documents needed for industri attachment.The school tried the best to organize best placement for all the students. After completing my training, the school guided me to submit the logbook and very responsive to help me to get the Diploma certificate which is very important for me to apply professional job in Hospitality industry. Thank you BMC ƒ∞nternational Collegeüôè

Dewa
student of Diploma in International Hospitality', 'languageCode': 'en'}

